from sorting_objects import *
from operator import attrgetter
import random

b1 = bins('b1', 60, 60, 3, 0, [])
b2 = bins('b2', 80, 80, 4, 0, [])
b3 = bins('b3', 100, 100, 3, 0, [])
b4 = bins('b4', 120, 120, 8, 0, [])
b5 = bins('b5', 120, 120, 6, 0, [])
b6 = bins('b6', 80, 80, 5.5, 0, [])
b7 = bins('b7', 100, 100, 4, 0, [])

i1 = items('i1', 50)
i2 = items('i2', 60)
i3 = items('i3', 30)
i4 = items('i4', 20)
i5 = items('i5', 25)
i6 = items('i6', 10)
i7 = items('i7', 30)
i8 = items('i8', 50)
i9 = items('i9', 14)


bin_objects = [b1, b2, b3, b4, b5, b6, b7]

item_objects = [i1, i2, i3, i4, i5, i6, i7, i8, i9]

for b in bin_objects:
    b.cv_ratio = b.cost / b.volume

ordered_bins = multisort(bin_objects, (('cv_ratio', False), ('volume', False)))

ordered_items = sorted(item_objects, key = attrgetter('volume'), reverse = True)

b4.items_contained = [i1, i2] 
b3.items_contained = [i7, i6] 
b5.items_contained = [i3, i4] 
b6.items_contained = [i5, i8] 

for b in bin_objects: 
    for i in b.items_contained: 
        b.remaining_volume -= i.volume 

filled_bins = [b4, b3, b5, b6]
unfilled_bins = []
for b in ordered_bins: 
    if b not in filled_bins:
        unfilled_bins.append(b)

ordered_bins = multisort(bin_objects, (('cv_ratio', False), ('volume', False)))
filled_bins = multisort(filled_bins, (('remaining_volume', False), ('cv_ratio', False))) 
unfilled_bins = multisort(unfilled_bins, (('cost', False), ('volume', True)))

print(ordered_bins)
print("filled_bins: " + str(filled_bins))
print(unfilled_bins)

cost = 0 
